@s_o_i_r_e_a_u ミニキャブだと、16kWhか10.5kWh
リーフも前のモデルだとすると、24～30kWhですから、荷物+坂道だと、バッテリー残量が気になるかもしれませんね。

現行のリーフe+なら62kWh、TESLA Model 3 Long Rangeだと75kWhなので、駐車スペースに充電器があれば、バッテリー残量は気にしなくて大丈夫です。

